import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: wrap;
`;

export const Wrapper = styled.div`
  header {
    display: flex;
    align-items: center;

    min-height: 100px;
    margin-left: 20px;

    svg {
      width: 80px;
      height: 80px;
      color: red;
      margin-right: 10px;
    }

    h2 {
      font-size: 40px;
    }
  }
`;
